two different approaches.

Creating objects
Let’s dive into code a bit, shall we? How could we set up our code in order to allow us to create our
myCar object, ending up with an object that is a Car and can therefore honk and drive?
Well, in the most simple sense, we can create our object completely from scratch, or ex nihilo if you
prefer the boaster expression.
It works like this:
1

var myCar = {};

2
3
4
5

myCar.honk = function() {
console.log('honk honk');
};

6
7
8
9

myCar.drive = function() {
console.log('vrooom...');
};

This gives us an object called myCar that is able to honk and drive:

